This pandemic season hasn’t been easy on everyone but we can do our part in supporting our favourite local businesses to help them stay strong during this hard time. 

That's why we are giving mention to some of our successful local brands that have made Singapore proud over the years by gaining popularity internationally as well! 

These brands include:
