My recent trip to Singapore I captured this shot at Marina Bay Sands with my Sony A6000+Sony10-18mm F4 lens.
@marinabaysands #Singapore#marinabaysands
#landscape #sonyemount #sonya6000 #wideangle #ndfilter #bay #architecture #surreal #shoppesatmarinabaysands #rediscoversg #water#travel #traveling

Oasis Terraces, the central community plaza framed by a series of lush garden terraces sloping towards the waterway not only plays an aesthetic role in the site, but also builds bonding among the community through its status as a horticultural project for residents to maintain. There are also some water-saving features such as rain garden & water wheel, that collect & treat rainwater, which is then used to irrigate plants at the gardens.

